import './App.css';
import { BrowserRouter as Router, Route, Routes, useLocation } from 'react-router-dom';
import { SwitchTransition, CSSTransition } from 'react-transition-group';
import Header from './components/Header';
import Imprint from './components/Imprint';
import Navigation from './components/Navigation';
import Footer from './components/Footer';
import Service from './components/Service';
import Profile from './components/Profile';
import Work from './components/Work';
import Process from './components/Process';
import PersonaKit from './work/PersonaKit';
import DentaltechnikWeber from './work/DentaltechnikWeber';
import ShapeUp from './work/ShapeUp';
import Lottie from 'lottie-react';
import logoAnimation from './lottie/logoAnimation.json';
import { useState, useEffect } from 'react';

function App() {
  const location = useLocation();
  const [isTransitioning, setIsTransitioning] = useState(false);

  useEffect(() => {
    window.scrollTo(0, 0);
  }, [location]);

  useEffect(() => {
    if (isTransitioning) {
      const timer = setTimeout(() => {
        setIsTransitioning(false);
      }, 1100); // Set the duration to match the animation length
      return () => clearTimeout(timer);
    }
  }, [isTransitioning]);

  return (
    <div className="App flex flex-col items-center w-full">
      <Navigation />
      <SwitchTransition>
        <CSSTransition
          key={location.key}
          timeout={1100}
          classNames="fade"
          addEndListener={(node, done) => {
            node.addEventListener('transitionend', done, false);
          }}
          onEnter={() => setIsTransitioning(true)}
          onExited={() => setIsTransitioning(false)}
        >
          <div className="relative w-full h-full">
            <Routes location={location} className="w-full">
              <Route
                path="/"
                element={
                  <>
                    <Header />
                    <Work />
                    <Process />
                    <Profile />
                    <Service />
                    <section className='w-full bg-white'>
                      <Footer />
                    </section>
                  </>
                }
              />
              <Route
                path="/imprint"
                element={
                  <>
                    <Imprint />
                    <section className='w-full bg-white'>
                      <Footer />
                    </section>
                  </>
                }
              />
              <Route
                path="/personakit"
                element={
                  <>
                    <PersonaKit />
                    <section className='w-full bg-white'>
                      <Footer />
                    </section>
                  </>
                }
              />
              <Route
                path="/dentaltechnik-weber"
                element={
                  <>
                    <DentaltechnikWeber />
                    <section className='w-full bg-white'>
                      <Footer />
                    </section>
                  </>
                }
              />
              <Route
                path="/shape-up"
                element={
                  <>
                    <ShapeUp />
                    <section className='w-full bg-white'>
                      <Footer />
                    </section>
                  </>
                }
              />
            </Routes>
            {/* Display the logo animation during transitions */}
            {isTransitioning && (
              <div className="fixed inset-0 bg-black flex items-center justify-center z-50">
                <Lottie animationData={logoAnimation} style={{ height: '200px', width: '200px' }} />
              </div>
            )}
          </div>
        </CSSTransition>
      </SwitchTransition>
    </div>
  );
}

export default function Root() {
  return (
    <Router>
      <App />
    </Router>
  );
}
